// 이 태그의 내용은 아래와 같아.
// 사용자 정의 태그를 만들 수 있다.
function Subject() {
  return (
    <header>
      <h1>WEB</h1>
      World wide web
    </header>
  );
}

function App() {
  return (
    <div className="App">
      <Subject></Subject>

      <nav>
        <ol>
          <li>
            <a href="1.html">HTML</a>
          </li>
          <li>
            <a href="2.html">CSS</a>
          </li>
          <li>
            <a href="3.html">Javascript</a>
          </li>
        </ol>
      </nav>

      <article>
        <h2>Welcome</h2>
        Hello React.
      </article>
    </div>
  );
}

export default App;
